import './App.css';
import Navbar from './components/Navbar';
import SignIn from './components/SignIn';
import { BrowserRouter,Routes,Route } from 'react-router-dom';


function App() {

  return (
    <>
   <BrowserRouter>
   <Routes>
   <Route exact path='/' element={<SignIn/>}/>
   </Routes>
   <Routes>
    <Route exact path='/navbar' element={<Navbar/>} />
   </Routes>
   </BrowserRouter>
    </>
  );
}

export default App;
